import React, { useState } from "react";
import Card from "../weather_card/card";

const Field = () => {
  const [val, setVal] = useState("");
  const [loc, setLocc] = useState("");
  return (
    <>
      <input
        type="text"
        value={val}
        onChange={(e) => {
          setVal(e.target.value);
        }}
      />
      <button
        onClick={() => {
          SetLocc(val);
        }}
      >
        Submit
      </button>
      <Card naam={loc} />
    </>
  );
};

export default Field;
